import React, { Component } from "react";
import './stage.css'
import Tasks from './Tasks'

class Stage extends Component {
    constructor(props){
        super(props)
        this.state={
            modal:''
        }
    } 
  render() {
      const{tasks,stageName}=this.props
      console.log(tasks)
    return (
      <div name='Stage'>
       <h4>{stageName}</h4>
       {<Tasks tasks={tasks}/>}
       <button >Add Task</button>
      </div>
    );
  }
}

export default Stage;
